	const [bikes, setBike] = useState("");

	useEffect(() => {
	}, [setBike])

	const getBikes = async ()  => {
        try {
            let res = await Api.getAllCrimes();
			setBike(res);
        } catch (error) {
        }
    }

return (
    <Wrapper>
        <Content>
			<Nav>
